function shuffle() {
    var today = Date.now(),
        evts = events.event.slice(),
        interval = [1800000, 3600000, 21600000, 43200000, 86400000], // 0.5 hour, 1 hour, 6 hours, 12 hours, 24 hours
        il = interval.length

    evts.forEach(e => { e.showTime = today - parseInt(interval[Math.floor(Math.random() * il)] * Math.random()) })

    return {
        code: 200,
        event: evts.sort(() => {
            return 0.5 - Math.random()
        })
    }
}

